import React from 'react';
import { Link } from 'react-router-dom';

const Cuisine = ({ cuisine }) => {
  return (
    <div>
      <Link to={`/cuisine/${cuisine._id}`}>
        <h2>{cuisine.name}</h2>
        <img src={cuisine.image} alt={cuisine.name} />
      </Link>
    </div>
  );
};

export default Cuisine;
